import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

// Sample project data
const projects = [
  {
    title: "AgroMaart - Online Fertilizer Shop",
    icon: "ri-shopping-cart-fill",
    description:
      "Built a user-friendly web application to improve fertilizer shop management...",
    additionalInfo: "Technologies: Spring Boot, Hibernate, MySQL, React, HTML, CSS",
    imageSrc: require("../../assets/images/AgroMart.webp"),
    animation: "fade-left",
  },
  {
    title: "Students Management System",
    icon: "ri-book-2-fill",
    description:
      "A web-based system to manage student records efficiently...",
    additionalInfo: "Technologies: Spring Boot, Hibernate, Thymeleaf, MySQL",
    imageSrc: require("../../assets/images/studentManagementSystem.webp"),
    animation: "fade-left",
  },
  {
    title: "Employee Management System",
    icon: "ri-user-3-fill",
    description:
      "A Java-based system utilizing MySQL and Hibernate for managing employee details...",
    additionalInfo: "Technologies: Java, MySQL, Hibernate",
   // imageSrc: null, // No image provided
    animation: "fade-left",
  },
];

// Default placeholder image
const placeholderImage = "https://via.placeholder.com/100";

// Styled Components
const Section = styled.section`
  padding: 4rem 2rem;
  background: linear-gradient(135deg, #d7e9f7, #e1f5fe);
  border-radius: 1rem;
  box-shadow: 0 8px 20px rgba(0, 0, 0, 0.1);
  transition: all 0.3s ease;
`;

const Container = styled.div`
  max-width: 1100px;
  margin: 0 auto;
  padding: 1rem;
`;

const SectionHeader = styled.div`
  text-align: center;
  margin-bottom: 3rem;
`;

const SectionTitle = styled.h2`
  color: #0288d1;
  font-weight: 600;
  font-size: 2.8rem;
  margin-bottom: 1rem;
  letter-spacing: 1.5px;
  text-transform: uppercase;
`;

const TimelineContent = styled.div`
  display: flex;
  flex-direction: column;
  gap: 2.5rem;
`;

const CardContainer = styled.div`
  display: flex;
  align-items: center;
  gap: 1.5rem;
  padding: 1.5rem;
  border-radius: 1rem;
  box-shadow: 0 6px 16px rgba(0, 0, 0, 0.1);
  background-color: ${(props) => props.bgColor || "#fff3e0"};
  transition: transform 0.3s ease, box-shadow 0.3s ease;
  
  &:hover {
    transform: scale(1.03);
    box-shadow: 0 8px 18px rgba(0, 0, 0, 0.15);
  }
`;

const IconContainer = styled.div`
  flex-shrink: 0;
`;

const IconImage = styled.img`
  width: 80px;
  height: 80px;
  object-fit: cover;
  border-radius: 50%;
`;

const CardContent = styled.div`
  flex: 1;
`;

const CardTitle = styled.h3`
  font-weight: 700;
  font-size: 1.8rem;
  color: #0277bd;
`;

const CardDescription = styled.p`
  font-size: 1rem;
  color: #455a64;
  margin-top: 0.75rem;
`;

const CardAdditionalInfo = styled.p`
  font-size: 0.9rem;
  color: #607d8b;
  margin-top: 0.5rem;
  font-style: italic;
`;

const colorPalette = ["#e3f2fd", "#e8f5e9", "#fff3e0", "#f3e5f5", "#fbe9e7"];

const Project = () => {
  return (
    <Section id="project">
      <Container>
        <SectionHeader>
          <SectionTitle>Projects</SectionTitle>
        </SectionHeader>
        <TimelineContent>
          {projects.map((project, index) => (
            <TimelineCard key={index} index={index} {...project} />
          ))}
        </TimelineContent>
      </Container>
    </Section>
  );
};

const TimelineCard = ({ title, icon, description, additionalInfo, imageSrc, animation, index }) => {
  return (
    <CardContainer bgColor={colorPalette[index % colorPalette.length]} data-aos={animation}>
      <IconContainer>
        <IconImage src={imageSrc || placeholderImage} alt={`Icon for ${title}`} />
      </IconContainer>
      <CardContent>
        <CardTitle>
          {icon && <i className={`${icon} mr-2`} aria-hidden="true"></i>} {title}
        </CardTitle>
        <CardDescription>{description}</CardDescription>
        {additionalInfo && <CardAdditionalInfo>{additionalInfo}</CardAdditionalInfo>}
      </CardContent>
    </CardContainer>
  );
};

TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string,
  animation: PropTypes.string.isRequired,
  index: PropTypes.number.isRequired,
};

export default Project;
